import {
    CopilotIcon,
    GitPullRequestIcon,
    InboxIcon,
    MarkGithubIcon,
    ThreeBarsIcon,
} from '@primer/octicons-react'
import { Avatar, Box, Heading, IconButton } from '@primer/react'

export function Navigation() {
    const src = 'https://avatars.githubusercontent.com/u/13389614?v=4'

    return (
        <Box
            sx={{
                display: 'flex',
                bg: 'canvas.subtle',
                borderBottom: '1px solid',
                borderColor: 'border.default',
                gap: '3',
                alignItems: 'center',
                p: 3,
            }}
        >
            <IconButton icon={ThreeBarsIcon} aria-label="Open menu" />
            <MarkGithubIcon size={32} />
            <Heading
                sx={{
                    fontSize: '1rem',
                }}
            >
                Avocado Corp.
            </Heading>
            <Box
                sx={{
                    display: 'flex',
                    gap: '2',
                    alignItems: 'center',
                }}
            >
                <IconButton
                    icon={GitPullRequestIcon}
                    aria-label="Open pull requests"
                    sx={{
                        color: 'fg.muted',
                    }}
                />
                <IconButton icon={InboxIcon} aria-label="Open inbox" />
                <IconButton icon={CopilotIcon} aria-label="Open Copilot" />
                <Avatar size={32} src={src} />
            </Box>
        </Box>
    )
}
